> \u0437\u0430 \u0432\u0441\u044e \u0438\u0445 \u0438\u0441\u0442\u043e\u0440\u0438\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/49_%D0%B3%D0%BE%D0%B4_%D0%B4%D0%BE_%D0%BD._%D1%8D.\" title=\"49 \u0433\u043e\u0434 \u0434\u043e \u043d. \u044d.\">49 \u0434\u043e&#160;\u043d.&#160;\u044d.<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B9_%D0%AE%D0%BB%D0%B8%D0%B9_%D0%A6%D0%B5%D0%B7%D0%B0%D1%80%D1%8C\" title=\"\u0413\u0430\u0439 \u042e\u043b\u0438\u0439 \u0426\u0435\u0437\u0430\u0440\u044c\">\u0413\u0430\u0439 \u042e\u043b\u0438\u0439 \u0426\u0435\u0437\u0430\u0440\u044c<\/a> \u0440\u0430\u0437\u0431\u0438\u043b \u0443 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D1%83_%D0%9B%D0%B5%D1%80%D0%B8%D0%B4%D1%8B&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0411\u0438\u0442\u0432\u0430 \u0443 \u041b\u0435\u0440\u0438\u0434\u044b (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041b\u0435\u0440\u0438\u0434\u044b<\/a> \u0430\u0440\u043c\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BC%D0%BF%D0%B5%D0%B9_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u041f\u043e\u043c\u043f\u0435\u0439 \u0412\u0435\u043b\u0438\u043a\u0438\u0439\">\u041f\u043e\u043c\u043f\u0435\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/47_%D0%B3%D0%BE%D0%B4_%D0%B4%D0%BE_%D0%BD._%D1%8D.\" title=\"47 \u0433\u043e\u0434 \u0434\u043e \u043d. \u044d.\">47 \u0434\u043e&#160;\u043d.&#160;\u044d.<\/a>&#160;\u2014 \u0413\u0430\u0439 \u042e\u043b\u0438\u0439 \u0426\u0435\u0437\u0430\u0440\u044c, \u0440\u0430\u0437\u0431\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D0%BF%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D1%86%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0411\u043e\u0441\u043f\u043e\u0440\u0441\u043a\u043e\u0435 \u0446\u0430\u0440\u0441\u0442\u0432