u0433\u0435\u043b\u044c\u043c II (\u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438)\">\u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c II \u0420\u044b\u0436\u0438\u0439<\/a> (\u0435\u0441\u0442\u044c \u0432\u0435\u0440\u0441\u0438\u044f, \u0447\u0442\u043e \u0435\u0433\u043e \u043f\u043e\u0434\u0441\u0442\u0440\u0435\u043b\u0438\u043b \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0431\u0440\u0430\u0442, \u0431\u0443\u0434\u0443\u0449\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_I_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B8)\" title=\"\u0413\u0435\u043d\u0440\u0438\u0445 I (\u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438)\">\u0413\u0435\u043d\u0440\u0438\u0445 I<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1377_%D0%B3%D0%BE%D0%B4\" title=\"1377 \u0433\u043e\u0434\">1377<\/a>&#160;\u2014 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u043d\u043e\u0435 \u0440\u0443\u0441\u0441\u043a\u043e\u0435 \u0432\u043e\u0439\u0441\u043a\u043e \u043f\u043e\u0434 \u043f\u0440\u0435\u0434\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c \u043a\u043d\u044f\u0437\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B2%D0%B0%D0%BD_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B5%D0%B2%D0%B8%D1%87_(%D1%81%D1%83%D0%B7%D0%B4%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%BE-%D0%BD%D0%B8%D0%B6%D0%B5%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BD%D1%8F%D0%B6%D0%B8%D1%87)\" title=\"\u0418\u0432\u0430\u043d \u0414\u043c\u0438\u0442\u0440\u0438\u0435\u0432\u0438\u0447 (\u0441\u0443\u0437\u0434\u0430\u043b\u044c\u0441\u043a\u043e-\u043d\u0438\u0436\u0435\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u0439 \u043a\u043d\u044f\u0436\u0438\u0447)\">\u0418\u0432\u0430\u043d\u0430 \u0414\u043c\u0438\u0442\u0440\u0438\u0435\u0432\u0438\u0447\u0430<\/a> \u0440\u0430\u0437\u0431\u0438\u0442\u043e \u043e\u0440\u0434\u044b\u043d\u0441\u043a\u0438\u043c \u0432\u043e\u0439\u0441\u043a\u043e\u043c \u043f\u043e\u0434 \u043f\u0440\u0435\u0434\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c \u0446\u0430\u0440\u0435\u0432\u0438\u0447\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B0%D0%BF%D1%88%D0%B0\" title=\"\u0410\u0440\u0430\u043f\u0448\u0430\">\u0410\u0440\u0430\u0431-\u0448\u0430\u0445\u0430 \u041c\u0443\u0437\u0430\u0444\u0444\u0430\u0440\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BD%D0%B0_%D1%80%D0%B5%D0%BA%D0%B5_%D0%9F%D1%8C%D1%8F%D0%BD%D0%B5_(1377)\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043d\u0430 \u0440\u0435\u043a\u0435 \u041f\u044c\u044f\u043d\u0435 (1377)\">\u0411\u0438\u0442\u0432\u0435 \u043d\u0430 \u0440\u0435\u043a\u0435 \u041f\u044c\u044f\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1492_%D0%B3%D0%BE%D0%B4\" title=\"1492 \u0433\u043e\u0434\">1492<\/a>&#160;\u2014 \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D0%B3%D0%B0%D0%BC%D0%B1%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%B5%D0%BA%D1%80%D0%B5%D1%82\" class=\"mw-redirect\" title=\"\u0410\u043b\u044c\u0433\u0430\u043c\u0431\u0440\u0441\u043a\u0438\u0439 \u0434\u0435\u043a\u0440\u0435\u0442\">\u0410\u043b\u044c\u0433\u0430\u043c\u0431\u0440\u0441\u043a\u0438\u043c \u0434\u0435\u043a\u0440\u0435\u0442\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%B5%D0%B8\" title=\"\u0415\u0432\u0440\u0435\u0438\">\u0435\u0432\u0440\u0435\u0438<\/a> \u0434\u043e\u043b\u0436\u043d\u044b \u0431\u044b\u043b\u0438 \u043f\u043e\u043a\u0438\u043d\u0443\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u044e<\/a> \u0432 \u0441\u0440\u043e\u043a \u0434\u043e 2 \u0430\u0432\u0433\u0443\u0441\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1552_%D0%B3%D0%BE%D0%B4\" title=\"1552 \u0433\u043e\u0434\">1552<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%81%D1%81%D0%B0%D1%83\" title=\"\u041f\u0430\u0441\u0441\u0430\u0443\">\u041f\u0430\u0441\u0441\u0430\u0443<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d \u0434\u043e\u0433\u043e\u0432\u043e\u0440, \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u0438\u0432\u0448\u0438\u0439 \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430\u043d\u0442\u0441\u043a\u0438\u043c \u043a\u043d\u044f\u0437\u044c\u044f\u043c \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 \u0441\u0432\u043e\u0431\u043e\u0434\u0443 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0442\u044c \u0440\u0435\u043b\u0438\u0433\u0438\u044e \u0441\u0432\u043e\u0438\u0445 \u043f\u043e\u0434\u0434\u0430\u043d\u043d\u044b\u0445.<\/li><li>\u0413\u0435\u0440\u0446\u043e\u0433 \u0421\u0430\u043a\u0441\u043e\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%B3%D0%B0%D0%BD%D0%BD-%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B4%D1%83%D1%88%D0%BD%D1%8B%D0%B9\" class=\"mw-redirect\" title=\"\u0418\u043e\u0433\u0430\u043d\u043d-\u0424\u0440\u0438\u0434\u0440\u0438\u0445 \u0412\u0435\u043b\u0438\u043a\u043e\u0434\u0443\u0448\u043d\u044b\u0439\">\u0418\u043e\u0433\u0430\u043d\u043d \u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a<\/a> \u0432\u044b\u043f\u0443\u0449\u0435\u043d \u043d\u0430 \u0441\u0432\u043e\u0431\u043e\u0434\u0443 \u043f\u043e\u0441\u043b\u0435 \u0448\u0435\u0441\u0442\u0438 \u043b\u0435\u0442 \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u0443 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B