/wiki\/%D0%A0%D0%B5%D1%87%D1%8C_%D0%9F%D0%BE%D1%81%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B0%D1%8F\" title=\"\u0420\u0435\u0447\u044c \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u0430\u044f\">\u0420\u0435\u0447\u044c \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u0430\u044f<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u043b\u0438 \u043f\u0435\u0440\u0435\u043c\u0438\u0440\u0438\u0435 \u043d\u0430 4 \u0433\u043e\u0434\u0430, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0432\u043e\u0439\u0441\u043a\u0430 \u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439 \u043e\u0431\u044f\u0437\u044b\u0432\u0430\u043b\u0438\u0441\u044c \u0443\u0439\u0442\u0438 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%88%D0%B8%D0%BD%D0%BE\" title=\"\u0422\u0443\u0448\u0438\u043d\u043e\">\u0422\u0443\u0448\u0438\u043d\u0430<\/a>, \u043c\u0435\u0441\u0442\u0430 \u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B6%D0%B5%D0%B4%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_I\" title=\"\u041b\u0436\u0435\u0434\u043c\u0438\u0442\u0440\u0438\u0439 I\">\u041b\u0436\u0435\u0434\u043c\u0438\u0442\u0440\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1610_%D0%B3%D0%BE%D0%B4\" title=\"1610 \u0433\u043e\u0434\">1610<\/a>&#160;\u2014 \u043c\u043e\u0440\u0435\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%B4%D1%81%D0%BE%D0%BD,_%D0%93%D0%B5%D0%BD%D1%80%D0%B8\" class=\"mw-redirect\" title=\"\u0425\u0430\u0434\u0441\u043e\u043d, \u0413\u0435\u043d\u0440\u0438\">\u0413\u0435\u043d\u0440\u0438 \u0413\u0443\u0434\u0437\u043e\u043d<\/a> \u043e\u0442\u043a\u0440\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B4%D0%B7%D0%BE%D0%BD%D0%BE%D0%B2_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2\" title=\"\u0413\u0443\u0434\u0437\u043e\u043d\u043e\u0432 \u0437\u0430\u043b\u0438\u0432\">\u0413\u0443\u0434\u0437\u043e\u043d\u043e\u0432 \u0437\u0430\u043b\u0438\u0432<\/a>, \u0431\u0443\u0434\u0443\u0447\u0438 \u0443\u0432\u0435\u0440\u0435\u043d\u043d\u044b\u043c, \u0447\u0442\u043e \u043e\u043d \u0432\u044b\u0448\u0435\u043b \u0421\u0435\u0432\u0435\u0440\u043d\u044b\u043c \u043f\u0443\u0442\u0451\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%B8%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u0422\u0438\u0445\u0438\u0439 \u043e\u043a\u0435\u0430\u043d\">\u0422\u0438\u0445\u0438\u0439 \u043e\u043a\u0435\u0430\u043d<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1713_%D0%B3%D0%BE%D0%B4\" title=\"1713 \u0433\u043e\u0434\">1713<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0446\u044b \u043f\u0440\u0438\u0431\u044b\u043b\u0438 \u0432 \u041b\u0443\u0439\u0441\u0431\u0443\u0440\u0433 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1718_%D0%B3%D0%BE%D0%B4\" title=\"1718 \u0433\u043e\u0434\">1718<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0438\u044f<\/a> \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A1%D0%BE%D1%8E%D0%B7_%D1%87%D0%B5%D1%82%D1%8B%D1%80%D1%91%D1%85&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0421\u043e\u044e\u0437 \u0447\u0435\u0442\u044b\u0440\u0451\u0445 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0421\u043e\u044e\u0437 \u0447\u0435\u0442\u044b\u0440\u0451\u0445<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1727_%D0%B3%D0%BE%D0%B4\" title=\"1727 \u0433\u043e\u0434\">1727<\/a>&#160;\u2014 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_II\" title=\"\u041f\u0451\u0442\u0440 II\">\u041f\u0451\u0442\u0440 II<\/a> \u0438\u0437\u0434\u0430\u043b \u0443\u043a\u0430\u0437 \u043e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0438 \u0432\u044b\u0431\u043e\u0440\u043d\u043e\u0439 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%82%D0%BC%D0%B0%D0%BD\" title=\"\u0413\u0435\u0442\u043c\u0430\u043d\">\u0433\u0435\u0442\u043c\u0430\u043d\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BB%D0%B0%D1%8F_%D0%A0%D1%83%D1%81%D1%8C\" title=\"\u041c\u0430\u043b\u0430\u044f \u0420\u0443\u0441\u044c\">\u041c\u0430\u043b\u043e\u0440\u043e\u0441\u0441\u0438\u0438<\/a>, \u043d\u043e \u043f\u0440\u0438 \u044d\u0442\u043e\u043c \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u043b\u043e\u0441\u044c, \u0447\u0442\u043e \u0433\u0435\u0442\u043c\u0430\u043d\u043e\u043c \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u0442\u044c \u0438\u0437\u0431\u0440\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D0%BE%D1%81%D1%82%D0%BE%D0%BB,_%D0%94%D0%B0%D0%BD%D0%B8%D0%B8%D0%BB_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0410\u043f\u043e\u0441\u0442\u043e\u043b, \u0414\u0430\u043d\u0438\u0438\u043b \u041f\u0430\u0432\u043b\u043e\u0432\u0438\u0447\">\u0414\u0430\u043d\u0438\u0438\u043b \u0410\u043f\u043e\u0441\u0442\u043e\u043b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1769_%D0%B3%D0%BE%D0%B4\" title=\"1769 \u0433\u043e\u0434\">1769<\/a>&#160;\u2014 \u0438\u0441\u043f\u0430\u043d\u0446\u044b \u043e\u0441\u043d\u043e\u0432\u0430\u043b\u0438 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0438\u0435 \u041d\u0443\u044d\u0441\u0442\u0440\u0430 \u0421\u0435\u043d\u044c\u043e\u0440\u0430 \u043b\u0430 \u0420\u0435\u0439\u043d\u0430 \u0434\u0435 \u041b\u043e\u0441 \u0410\u043d\u0434\u0436\u0435\u043b\u0435\u0441 \u0434\u0435 \u041f\u043e\u0440\u0446\u0438\u0443\u043d\u0446\u0438\u043b\u0430 (\u0441\u0435\u0439\u0447\u0430\u0441&#160;\u2014 \u043f\u0440\u043e\u0441\u0442\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D1%81-%D0%90%D0%BD%D0%B4%D0%B6%D0%B5%D0%BB%D0%B5%D1%81\" title=\"\u041b\u043e\u0441-\u0410\u043d\u0434\u0436\u0435\u043b\u0435\u0441\">\u041b\u043e\u0441-\u0410\u043d\u0434\u0436\u0435\u043b\u0435\u0441<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1776_%D0%B3%D0%BE%D0%B4\" title=\"1776 \u0433\u043e\u0434\">1776<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044f \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BA%D0%BB%D0%B0%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%D0%BD%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D0%B8\" title=\"\u0414\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044f \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438\">\u0414\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u0438 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438<\/a>, \u043f\u0440\u0438\u043d\u044f\u0442\u043e\u0439 4 \u0438\u044e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%82%D0%B8%D0%BD%D0%B5%D0%BD%D1%82%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81\" title=\"\u041a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\">\u041a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u043c \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u043e\u043c<\/a> \u0438 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u0432\u0448\u0435\u0439 \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u0435 13 \u0441\u0435\u0432\u0435\u0440\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u043a\u043e\u043b\u043e\u043d\u0438\u0439 \u043e\u0442 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438. \u0422\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c \u0431\u044b\u043b\u043e \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u043e \u043d\u043e\u0432\u043e\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BD%D1%8C_%D0%BD%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D0%B8_%D0%A1%D0%A8%D0%90\" title=\"\u0414\u0435\u043d\u044c \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u0421\u0428\u0410\">\u0414\u0435\u043d\u044c \u041d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u0421\u0428\u0410<\/a> \u043f\u0440\u0430\u0437\u0434\u043d\u0443\u0435\u0442\u0441\u044f 4 \u0438\u044e\u043b\u044f, \u0430 2 \u0430\u0432\u0433\u0443\u0441\u0442\u0430 \u043c\u043e\u0436\u0435\u0442 \u0441\u0447\u0438\u0442\u0430\u0442\u044c\u0441\u044f \u0434\u043d\u0451\u043c, \u043a\u043e\u0433\u0434\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0431\u044b\u043b\u0430 \u0437\u0430\u043a\u0440\u0435\u043f\u043b\u0435\u043d\u0430 \u0434\u0435-\u044e\u0440\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1790_%D0%B3%D0%BE%D0%B4\" title=\"1790 \u0433\u043e\u0434\">1790<\/a>&#160;\u2014 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B5%D0%BF%D0%B8%D1%81%D1%8C_%D0%BD%D0%B0%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F_%D0%A1%D0%A8%D0%90_(1790)\" title=\"\u041f\u0435\u0440\u0435\u043f\u0438\u0441\u044c \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u0421\u0428\u0410 (1790)\">\u043f\u0435\u0440\u0432\u0430\u044f \u043f\u0435\u0440\u0435\u043f\u0438\u0441\u044c \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1794_%D0%B3%D0%BE%D0%B4\" title=\"1794 \u0433\u043e\u0434\">1794<\/a>&#160;\u2014 \u0437\u0430 \u043f\u0440\u0438\u0432\u0435\u0440\u0436\u0435\u043d\u043d\u043e\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B1%D0%B5%D1%81%D0%BF%D1%8C%D0%B5%D1%80,_%D0%9C%D0%B0%D0%BA%D1%81%D0%B8%D0%BC%D0%B8%D0%BB%D0%B8%D0%B0%D0%BD\" title=\"\u0420\u043e\u0431\u0435\u0441\u043f\u044c\u0435\u0440, \u041c\u0430\u043a\u0441\u0438\u043c\u0438\u043b\u0438\u0430\u043d\">\u0420\u043e\u0431\u0435\u0441\u043f\u044c\u0435\u0440\u0443<\/a> \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a, \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%B2%D0%B8%D0%B4,_%D0%96%D0%B0%D0%BA-%D0%9B%D1%83%D0%B8\" title=\"\u0414\u0430\u0432\u0438\u0434, \u0416\u0430\u043a-\u041b\u0443\u0438\">\u0416\u0430\u043a \u041b\u0443\u0438 \u0414\u0430\u0432\u0438\u0434<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0440\u043e\u0431\u0443\u0434\u0435\u0442 \u0432 \u0442\u044e\u0440\u044c\u043c\u0435 \u0440\u043e\u0432\u043d\u043e \u0433\u043e\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1796_%D0%B3%D0%BE%D0%B4\" title=\"1796 \u0433\u043e\u0434\">1796<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d<\/a> \u0440\u0430\u0437\u0431\u0438\u043b \u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0446\u0435\u0432 \u0432 \u0431\u0438\u0442\u0432\u0435 \u0443 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D1%83_%D0%9B%D0%BE%D0%BD%D0%B0%D1%82%D0%BE&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0411\u0438\u0442\u0432\u0430 \u0443 \u041b\u043e\u043d\u0430\u0442\u043e (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041b\u043e\u043d\u0430\u0442\u043e<\/a> (\u041b\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u044f).<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1802_%D0%B3%D0%BE%D0%B4\" title=\"1802 \u0433\u043e\u0434\">1802<\/a>&#160;\u2014 \u043f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d<\/a> \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d \u043f\u043e\u0436\u0438\u0437\u043d\u0435\u043d\u043d\u044b\u043c \u043a\u043e\u043d\u0441\u0443\u043b\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1806_%D0%B3%D0%BE%D0%B4\" title=\"1806 \u0433\u043e\u0434\">1806<\/a>&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B5%D0%B9%D0%B7%D0%B5%D1%80,_%D0%A1%D0%B0%D0%B9%D0%BC%D0%BE%D0%BD\" title=\"\u0424\u0440\u0435\u0439\u0437\u0435\u0440, \u0421\u0430\u0439\u043c\u043e\u043d\">\u0421\u0430\u0439\u043c\u043e\u043d \u0424\u0440\u0435\u0439\u0437\u0435\u0440<\/a> \u043d\u0430\u0437\u0432\u0430\u043b \u043d\u043e\u0432\u044b\u0435 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f\">\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0432\u043e\u0439 \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%B5%D1%81%D1%81%D0%B0\" title=\"\u041e\u0434\u0435\u0441\u0441\u0430\">\u041e\u0434\u0435\u0441\u0441\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u044d\u043f\u0438\u0434\u0435\u043c\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D1%83%D0%BC%D0%B0_%D0%B2_%D0%9E%D0%B4%D0%B5%D1%81%D1%81%D0%B5\" title=\"\u0427\u0443\u043c\u0430 \u0432 \u041e\u0434\u0435\u0441\u0441\u0435\">\u0447\u0443\u043c\u044b<\/a>, \u043e\u0442 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0441\u043a\u043e\u043d\u0447\u0430\u043b\u0441\u044f \u043a\u0430\u0436\u0434\u044b\u0439 9-\u0439 \u0436\u0438\u0442\u0435\u043b\u044c \u0433\u043e\u0440\u043e\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1824_%D0%B3%D0%BE%D0%B4\" title=\"1824 \u0433\u043e\u0434\">1824<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%8F%D1%82%D0%B0%D1%8F_%D0%B0%D0%B2%D0%B5%D0%BD%D1%8E_(%D0%9C%D0%B0%D0%BD%D1%85%D1%8D%D1%82%D1%82%D0%B5%D0%BD)\" class=\"mw-redirect\" title=\"\u041f\u044f\u0442\u0430\u044f \u0430\u0432\u0435\u043d\u044e (\u041c\u0430\u043d\u0445\u044d\u0442\u0442\u0435\u043d)\">\u041f\u044f\u0442\u0430\u044f \u0430\u0432\u0435\u043d\u044e<\/a>, \u0441\u0442\u0430\u0432\u0448\u0430\u044f \u043c\u0435\u0441\u0442\u043e\u043c \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u044f \u0441\u0430\u043c\u044b\u0445 \u0444\u0435\u0448\u0435\u043d\u0435\u0431\u0435\u043b\u044c\u043d\u044b\u0445 \u043c\u0430\u0433\u0430\u0437\u0438\u043d\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830_%D0%B3%D0%BE%D0%B4\" title=\"1830 \u0433\u043e\u0434\">1830<\/a>&#160;\u2014 \u043e\u0442\u0440\u0451\u043a\u0441\u044f \u043e\u0442 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0430 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_X_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b X (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u041a\u0430\u0440\u043b X<\/a> (\u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0438\u0437 \u0441\u0442\u0430\u0440\u0448\u0435\u0439 \u0432\u0435\u0442\u0432\u0438 \u0434\u0438\u043d\u0430\u0441\u0442\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%80%D0%B1%D0%BE%D0%BD%D1%8B\" title=\"\u0411\u0443\u0440\u0431\u043e\u043d\u044b\">\u0411\u0443\u0440\u0431\u043e\u043d\u043e\u0432<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1858_%D0%B3%D0%BE%D0%B4\" title=\"1858 \u0433\u043e\u0434\">1858<\/a>&#160;\u2014 \u0432 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0435 \u0441\u043e\u0437\u0434\u0430\u043d\u0430 \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u0430\u044f \u043a\u043e\u043b\u043e\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f\">\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1887_%D0%B3%D0%BE%D0%B4\" title=\"1887 \u0433\u043e\u0434\">1887<\/a>&#160;\u2014 \u0420\u043e\u0443\u044d\u043b\u043b\u043e\u043c \u0425\u043e\u0434\u0436\u0435\u043c (Rowell Hodge) \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043d\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%8E%D1%87%D0%B0%D1%8F_%D0%BF%D1%80%D0%BE%D0%B2%D0%BE%D0%BB%D0%BE%D0%BA%D0%B0\" title=\"\u041a\u043e\u043b\u044e\u0447\u0430\u044f \u043f\u0440\u043e\u0432\u043e\u043b\u043e\u043a\u0430\">\u043a\u043e\u043b\u044e\u0447\u0430\u044f \u043f\u0440\u043e\u0432\u043e\u043b\u043e\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900_%D0%B3%D0%BE%D0%B4\" title=\"1900 \u0433\u043e\u0434\">1900<\/a>&#160;\u2014 \u0432 \u0441\u0442\u044b\u0447\u043a\u0435 \u0441 \u043a\u0438\u0442\u0430\u0439\u0446\u0430\u043c\u0438 \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B9%D0%B3%D1%83%D0%BD%D1%8C\" title=\"\u0410\u0439\u0433\u0443\u043d\u044c\">\u0410\u0439\u0433\u0443\u043d\u043e\u043c<\/a> \u043f\u043e\u0433\u0438\u0431 \u0441\u0438\u0431\u0438\u0440\u0441\u043a\u0438\u0439 \u043f\u043e\u044d\u0442, \u0441\u043e\u0442\u043d\u0438\u043a \u0430\u043c\u0443\u0440\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%BA%D0%BE%D0%B2,_%D0%9B%D0%B5%D0%BE%D0%BD%D0%B8%D0%B4_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0412\u043e\u043b\u043a\u043e\u0432, \u041b\u0435\u043e\u043d\u0438\u0434 \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u041b\u0435\u043e\u043d\u0438\u0434 \u0412\u043e\u043b\u043a\u043e\u0432<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA%D0%B5%D0%B4%D0%BE%D0%BD%D0%B8%D1%8F_(%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)\" title=\"\u041c\u0430\u043a\u0435\u0434\u043e\u043d\u0438\u044f (\u043e\u0431\u043b\u0430\u0441\u0442\u044c)\">\u041c\u0430\u043a\u0435\u0434\u043e\u043d\u0438\u0438<\/a> \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0430\u043d\u0442\u0438\u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BB%D0%B8%D0%BD%D0%B4%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0418\u043b\u0438\u043d\u0434\u0435\u043d\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435\">\u0418\u043b\u0438\u043d\u0434\u0435\u043d\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906_%D0%B3%D0%BE%D0%B4\" title=\"1906 \u0433\u043e\u0434\">1906<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%83%D0%B3%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u044f\">\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u0438<\/a> \u0441\u043e\u0437\u0434\u0430\u043d \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u043b\u0443\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%83_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1)\" title=\"\u041f\u043e\u0440\u0442\u0443 (\u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u043b\u0443\u0431)\">\u00ab\u041f\u043e\u0440\u0442\u0443\u00bb<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%BE%D0%BC%D0%B5%D0%BD%D0%BB%D0%B8%D0%BD%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u0421\u0443\u043e\u043c\u0435\u043d\u043b\u0438\u043d\u043d\u0430\">\u0421\u0432\u0435\u0430\u0431\u043e\u0440\u0433\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f\">\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f<\/a>) \u0446\u0430\u0440\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u043f\u043e\u0434\u0430\u0432\u043b\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%B5%D0%B0%D0%B1%D0%BE%D1%80%D0%B3%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0421\u0432\u0435\u0430\u0431\u043e\u0440\u0433\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435\">\u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435<\/a> \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u043c\u0430\u0442\u0440\u043e\u0441\u043e\u0432.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a><ul><li>\u041d\u0430 \u0432\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u0430\u0440\u043c\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043f\u0440\u0438\u043d\u044f\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442<\/a>, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%82%D1%8C%D1%8F_%D0%A0%D0%B0%D0%B9%D1%82\" title=\"\u0411\u0440\u0430\u0442\u044c\u044f \u0420\u0430\u0439\u0442\">\u0431\u0440\u0430\u0442\u044c\u044f\u043c\u0438 \u0420\u0430\u0439\u0442<\/a>.<\/li><li>\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0446\u0430\u0440\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II<\/a> \u043f\u043e\u0441\u0435\u0442\u0438\u043b \u0432 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u0441\u0432\u043e\u0435\u0433\u043e \u0434\u044f\u0434\u044e&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u043e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4_VII\" title=\"\u042d\u0434\u0443\u0430\u0440\u0434 VII\">\u042d\u0434\u0443\u0430\u0440\u0434\u0430 VII<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u043c \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u043c II \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d \u043c\u0430\u043d\u0438\u0444\u0435\u0441\u0442 \u043e \u0432\u043e\u0439\u043d\u0435 \u0441 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0435\u0439 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0437\u0430\u0432\u043e\u0434 \u0410\u041c\u041e (\u0410\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\u043d\u043e\u0435 \u043c\u043e\u0442\u043e\u0440\u043d\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e). \u0412 \u043a\u043e\u043d\u0446\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933 \u0433\u043e\u0434\u0430<\/a> \u0431\u044b\u043b \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d \u0432 \u0417\u0418\u0421 (\u0437\u0430\u0432\u043e\u0434 \u0438\u043c\u0435\u043d\u0438 \u0421\u0442\u0430\u043b\u0438\u043d\u0430), \u0430 \u043f\u043e\u0441\u043b\u0435 \u0440\u0430\u0437\u043e\u0431\u043b\u0430\u0447\u0435\u043d\u0438\u044f \u043a\u0443\u043b\u044c\u0442\u0430 \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438 \u0441\u0442\u0430\u043b \u0438\u043c\u0435\u043d\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0417\u0418\u041b\u043e\u043c (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%B2%D0%BE%D0%B4_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%9B%D0%B8%D1%85%D0%B0%D1%87%D1%91%D0%B2%D0%B0\" title=\"\u0417\u0430\u0432\u043e\u0434 \u0438\u043c\u0435\u043d\u0438 \u041b\u0438\u0445\u0430\u0447\u0451\u0432\u0430\">\u0437\u0430\u0432\u043e\u0434\u043e\u043c \u0438\u043c\u0435\u043d\u0438 \u041b\u0438\u0445\u0430\u0447\u0451\u0432\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u043d\u0430 \u0443\u0447\u0435\u043d\u0438\u044f\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u043e\u043a\u0440\u0443\u0433\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u043e\u043a\u0440\u0443\u0433\u0430<\/a>, \u043d\u0430 \u043e\u043a\u0440\u0430\u0438\u043d\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%80%D0%BE%D0%BD%D0%B5%D0%B6\" title=\"\u0412\u043e\u0440\u043e\u043d\u0435\u0436\">\u0412\u043e\u0440\u043e\u043d\u0435\u0436\u0430<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432\u044b\u0441\u0430\u0436\u0435\u043d \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u0434\u0435\u0441\u0430\u043d\u0442 . \u0412\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u044d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u0441\u0442\u0430\u043b \u043e\u0442\u043c\u0435\u0447\u0430\u0442\u044c\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a>, \u0430 \u0442\u0435\u043f\u0435\u0440\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>, \u043a\u0430\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BD%D1%8C_%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D0%BE-%D0%B4%D0%B5%D1%81%D0%B0%D0%BD%D1%82%D0%BD%D1%8B%D1%85_%D0%B2%D0%BE%D0%B9%D1%81%D0%BA\" class=\"mw-redirect\" title=\"\u0414\u0435\u043d\u044c \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e-\u0434\u0435\u0441\u0430\u043d\u0442\u043d\u044b\u0445 \u0432\u043e\u0439\u0441\u043a\">\u0414\u0435\u043d\u044c \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e-\u0434\u0435\u0441\u0430\u043d\u0442\u043d\u044b\u0445 \u0432\u043e\u0439\u0441\u043a<\/a>. \u041f\u0435\u0440\u0432\u044b\u0445 \u0434\u0435\u0441\u0430\u043d\u0442\u043d\u0438\u043a\u043e\u0432 \u0431\u044b\u043b\u043e 12 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a><ul><li>\u041e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%BE%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE-%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB\" title=\"\u0411\u0435\u043b\u043e\u043c\u043e\u0440\u0441\u043a\u043e-\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u0430\u043b\">\u0411\u0435\u043b\u043e\u043c\u043e\u0440\u0441\u043a\u043e-\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u0430\u043b \u0438\u043c\u0435\u043d\u0438 \u0421\u0442\u0430\u043b\u0438\u043d\u0430<\/a>.<\/li><li>\u041d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D1%80%D0%B0%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D0%B2%D0%B0%D0%BB\" title=\"\u0421\u0443\u0440\u0430\u043c\u0441\u043a\u0438\u0439 \u043f\u0435\u0440\u0435\u0432\u0430\u043b\">\u0421\u0443\u0440\u0430\u043c\u0441\u043a\u043e\u043c \u043f\u0435\u0440\u0435\u0432\u0430\u043b\u0435<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043e\u0431\u043a\u0430\u0442\u043a\u0430 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u043c\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%B2%D0%BE%D0%B7\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u0432\u043e\u0437\">\u044d\u043b\u0435\u043a\u0442\u0440\u043e\u0432\u043e\u0437\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 \u043f\u043e\u0441\u043b\u0435 \u0441\u043c\u0435\u0440\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D1%85%D1%81%D0%BF%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82\" title=\"\u0420\u0435\u0439\u0445\u0441\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\">\u0440\u0435\u0439\u0445\u0441\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BD%D0%B4%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3,_%D0%9F%D0%B0%D1%83%D0%BB%D1%8C_%D1%84%D0%BE%D0%BD\" title=\"\u0413\u0438\u043d\u0434\u0435\u043d\u0431\u0443\u0440\u0433, \u041f\u0430\u0443\u043b\u044c \u0444\u043e\u043d\">\u0413\u0438\u043d\u0434\u0435\u043d\u0431\u0443\u0440\u0433\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D1%82%D0%BB%D0%B5%D1%80,_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0413\u0438\u0442\u043b\u0435\u0440, \u0410\u0434\u043e\u043b\u044c\u0444\">\u0410\u0434\u043e\u043b\u044c\u0444 \u0413\u0438\u0442\u043b\u0435\u0440<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%8E%D1%80%D0%B5%D1%80\" title=\"\u0424\u044e\u0440\u0435\u0440\">\u0444\u044e\u0440\u0435\u0440\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D1%80%D0%B5%D0%B9%D1%85\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0440\u0435\u0439\u0445\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BB%D0%B4%D0%B0%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u041c\u043e\u043b\u0434\u0430\u0432\u0441\u043a\u0430\u044f \u0421\u0421\u0420\">\u041c\u043e\u043b\u0434\u0430\u0432\u0441\u043a\u0430\u044f \u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u043d\u0430\u0446\u0438\u0441\u0442\u0430\u043c\u0438 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D1%80%D0%B0%D0%B6%D1%81%D0%BA%D0%BE%D0%B5_%D0%B3%D0%B5%D1%82%D1%82%D0%BE_(%D0%92%D0%B8%D1%82%D0%B5%D0%B1%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)\" title=\"\u0421\u0443\u0440\u0430\u0436\u0441\u043a\u043e\u0435 \u0433\u0435\u0442\u0442\u043e (\u0412\u0438\u0442\u0435\u0431\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c)\">\u