0441\u00bb \u043f\u0440\u0438 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0435 \u0430\u0432\u0438\u0430\u0446\u0438\u0438 \u0412\u041c\u0421 \u0421\u0428\u0410 \u043e\u0442\u0440\u0430\u0437\u0438\u043b \u0430\u0442\u0430\u043a\u0443 \u0442\u0440\u0451\u0445 \u0441\u0435\u0432\u0435\u0440\u043e\u0432\u044c\u0435\u0442\u043d\u0430\u043c\u0441\u043a\u0438\u0445 \u0442\u043e\u0440\u043f\u0435\u0434\u043d\u044b\u0445 \u043a\u0430\u0442\u0435\u0440\u043e\u0432, \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u043e\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u043d\u0430\u0445\u043e\u0434\u044f\u0441\u044c \u0432 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u0432\u043e\u0434\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC\" title=\"\u0414\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0412\u044c\u0435\u0442\u043d\u0430\u043c\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1972_%D0%B3%D0%BE%D0%B4\" title=\"1972 \u0433\u043e\u0434\">1972<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e\u0431 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\">\u0415\u0433\u0438\u043f\u0442\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0438\u0432\u0438\u044f\">\u041b\u0438\u0432\u0438\u0438<\/a> \u0432 \u0435\u0434\u0438\u043d\u043e\u0435 \u0433\u043e\u0441