20\u043e\u0441\u0441\u0438\u0438 \u043f\u0440\u0438\u0432\u0435\u0434\u0435\u043d \u0432 \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B5%D1%80%D1%82%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B0%D0%B7%D0%BD%D1%8C\" title=\"\u0421\u043c\u0435\u0440\u0442\u043d\u0430\u044f \u043a\u0430\u0437\u043d\u044c\">\u0441\u043c\u0435\u0440\u0442\u043d\u044b\u0439 \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440<\/a>. \u0412 \u044d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u0431\u044b\u043b \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u044f\u043d \u0443\u0431\u0438\u0439\u0446\u0430 11 \u043f\u043e\u0434\u0440\u043e\u0441\u0442\u043a\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BE%D0%B2%D0%BA%D0%B8%D0%BD,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87_(%D1%81%D0%B5%D1%80%D0%B8%D0%B9%D0%BD%D1%8B%D0%B9_%D1%83%D0%B1%D0%B8%D0%B9%D1%86%D0%B0)\" class=\"mw-redirect\" title=\"\u0413\u043e\u043b\u043e\u0432\u043a\u0438\u043d, \u0421\u0435\u0440\u0433\u0435\u0439 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447 (\u0441\u0435\u0440\u0438\u0439\u043d\u044b\u0439 \u0443\u0431\u0438\u0439\u0446\u0430)\">\u0421\u0435\u0440\u0433\u0435\u0439 \u0413\u043e\u043b\u043e\u0432\u043a\u0438\u043d<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%B7%D0%B0%D0%BA%D0%BE%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u043e\u0437\u0430\u043a\u043e\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u041c\u0438\u0445\u0430\u0438\u043b \u041a\u043e\u0437\u0430\u043a\u043e\u0432<\/a> \u043f\u0440\u0438\u0437\u043d\u0430\u043b\u0441\u044f, \u0447\u0442\u043e \u0431\u044b\u043b \u0430\u0433\u0435\u043d\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%B1%D0%B5%D0%B7%D0%BE%D0%BF%D0%B0%D1%81%D0%BD%D0%BE%D1%81%D1%82%D0%B8_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u041a\u043e\u043c\u0438\u0442\u0435\u0442 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0421\u0421\u0421\u0420\">\u041a\u0413\u0411<\/a>. \u00ab\u041f\u0440\u0435\u0434\u043f\u043e\u043b\u043e\u0436\u0438\u043c, \u043a\u0442\u043e-\u0442\u043e \u043f\u043e\u0441\u043c\u0435\u0451\u0442\u0441\u044f, \u043a\u0442\u043e-\u0442\u043e \u043d\u0435 \u043f\u043e\u0434\u0430\u0441\u0442 \u0440\u0443\u043a\u0438. \u0418 \u043d\u0435 \u0442\u043e, \u0447\u0442\u043e\u0431\u044b \u043c\u043d\u0435 \u044d\u0442\u043e \u0431\u0435\u0437\u0440\u0430\u0437\u043b\u0438\u0447\u043d\u043e. \u041d\u043e \u044f \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u043b \u044d\u0442\u043e \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0438 \u0441\u0434\u0435\u043b\u0430\u043b\u00bb,&#160;\u2014 \u0441\u043a\u0430\u0437\u0430\u043b \u041a\u043e\u0437\u0430\u043a\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2007_%D0%B3%D0%BE%D0%B4\" title=\"2007 \u0433\u043e\u0434\">2007<\/a>&#160;\u2014 \u043d\u0430 \u0433\u043b\u0443\u0431\u043e\u043a\u043e\u0432\u043e\u0434\u043d\u044b\u0445 \u043e\u0431\u0438\u0442\u0430\u0435\u043c\u044b\u0445 \u0430\u043f\u043f\u0430\u0440\u0430\u0442\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D1%83%D0%B1%D0%BE%D0%BA%D0%BE%D0%B2%D0%BE%D0%B4%D0%BD%D1%8B%D0%B5_%D0%BE%D0%B1%D0%B8%D1%82%D0%B0%D0%B5%D0%BC%D1%8B%D0%B5_%D0%B0%D0%BF%D0%BF%D0%B0%D1%80%D0%B0%D1%82%D1%8B_%C2%AB%D0%9C%D0%B8%D1%80%C2%BB\" class=\"mw-redirect\" title=\"\u0413\u043b\u0443\u0431\u043e\u043a\u043e\u0432\u043e\u0434\u043d\u044b\u0435 \u043e\u0431\u0438\u0442\u0430\u0435\u043c\u044b\u0435 \u0430\u043f\u043f\u0430\u0440\u0430\u0442\u044b \u00ab\u041c\u0438\u0440\u00bb\">\u041c\u0438\u0440<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u0431\u044b\u043b\u043e \u0434\u043e\u0441\u0442\u0438\u0433\u043d\u0443\u0442\u043e \u0434\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%9B%D0%B5%D0%B4%D0%BE%D0%B2%D0%B8%D1%82%D1%8B%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u041b\u0435\u0434\u043e\u0432\u0438\u0442\u044b\u0439 \u043e\u043a\u0435\u0430\u043d\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u041b\u0435\u0434\u043e\u0432\u0438\u0442\u043e\u0433\u043e \u043e\u043a\u0435\u0430\u043d\u0430<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BB%D1%8E%D1%81\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u043c \u043f\u043e\u043b\u044e\u0441\u0435<\/a>, \u0433\u0434\u0435 \u0431\u044b\u043b \u0440\u0430\u0437\u043c\u0435\u0449\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0424\u043b\u0430\u0433 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0444\u043b\u0430\u0433<\/a> \u0438 \u043a\u0430\u043f\u0441\u0443\u043b\u0430 \u0441 \u043f\u043e\u0441\u043b\u0430\u043d\u0438\u0435\u043c \u0431\u0443\u0434\u0443\u0449\u0438\u043c \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u044f\u043c.<\/li><\/ul><h2>"}